import { Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar/navbar"

import { 
  Home, 
  Revision, 
  Additions, 
  Transfer,
  Whoops404
} from './pages/pages';

function App() {
  return (
    <div>
        <Navbar/>
        <Routes>
          <Route  path="/" element={<Home/>}/>
            <Route  
              path="revision" 
              element={<Revision />}
            />
            <Route  
            path="additions" 
            element={<Additions />}
            />
            <Route  path="transfer" element={<Transfer />}/>
          <Route/>
          <Route  path="*" element={<Whoops404 />}/><Route/>
        </Routes>
    </div>
  );
}

export default App;
